import styles from "./Header.module.css"
import logo from "../../img/logo.png"

export const Header = () => {
    return (
        <header className={`${styles.header} wrapper`}>
            <div>
                <img src={logo} className="adaptive-img" />
            </div>
        </header>
    )
}
